import React from "react";
import Lottie from "react-lottie";
import { makeStyles } from "@mui/styles";
import { Grid, Typography, Box, Button } from "@mui/material";

import animationData from "../../animations/landinganimation/data";
import ArrowComponent from "./ArrowComponent";
import theme from "./theme";

const useStyle = makeStyles(() => ({
  esttimateBtn: {
    "&.MuiButtonBase-root": {
      ...theme.typography.estimateBtn,
      backgroundColor: theme.palette.common.orange,
      borderRadius: 50,
      height: 45,
      width: 145,
      "&:hover": {
        background: theme.palette.secondary.light,
      },
    },
  },
  learnMoreBtn: {
    "&.MuiButtonBase-root": {
      borderRadius: 50,
      height: 45,
      width: 145,
    },
  },
}));

const LottieController: React.FC = () => {
  const classes = useStyle();

  const defaultOptionsLottie = {
    loop: true,
    autoplay: true,
    animationData: animationData,
    rendererSettings: {
      preserveAspectRatio: "xMidYMid slice",
    },
  };
  return (
    <Grid container direction='column'>
      <Grid item>
        <Grid
          container
          direction='row'
          justifyContent='flex-end'
          alignItems='center'
          spacing={5}>
          <Grid item sm>
            <Typography align='center' variant='h2'>
              Bring West Coast Technology <br /> to the Midwest
            </Typography>
            <Grid container justifyContent='center' spacing={2}>
              <Grid item>
                <Button className={classes.esttimateBtn} variant='contained'>
                  Free Estimate
                </Button>
              </Grid>
              <Grid item>
                <Button variant='outlined' className={classes.learnMoreBtn}>
                  Learn more
                  <ArrowComponent width={15} height={15} fill='orange' />
                </Button>
              </Grid>
            </Grid>
          </Grid>
          <Grid
            style={{
              maxWidth: "50em",
              minWidth: "21em",
              marginLeft: "10%",
              marginTop: "1em",
            }}
            item
            sm>
            <Lottie
              options={defaultOptionsLottie}
              height={"100%"}
              width={"100%"}
            />
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default LottieController;
